-- ----------------------------
-- Table structure for cd_product
-- ----------------------------
DROP TABLE IF EXISTS `cd_product`;
CREATE TABLE `cd_product` (
  `id` mediumint(9) unsigned NOT NULL AUTO_INCREMENT,
  `cd_id` varchar(40) NOT NULL COMMENT 'cd的产品ID',
  `muti` varchar(40) NOT NULL DEFAULT '0' COMMENT '是否母体，0没有母体',
  `url_id` int(9) DEFAULT NULL COMMENT '采集的URL ID',
  `sku` varchar(40) NOT NULL COMMENT 'cd的产品sku',
  `store` varchar(50) NOT NULL COMMENT 'cd上的店铺名',
  `store_url` varchar(50) NOT NULL COMMENT 'cd上的店铺地址',
  `reviews` smallint(5) unsigned NOT NULL COMMENT '评论数量',
  `stars` float(2,1) NOT NULL COMMENT '评分',
  `price` decimal(9,2) NOT NULL COMMENT 'cd平台上价格',
  `gm_num` smallint(5) unsigned NOT NULL COMMENT '跟卖数量',
  `gm_price` decimal(6,2) NOT NULL COMMENT '跟卖最低价',
  `color` varchar(10) NOT NULL COMMENT '颜色',
  `shipfee` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `navs` varchar(60) NOT NULL COMMENT '分类导航',
  `title` varchar(100) NOT NULL COMMENT '长标题',
  `title1` varchar(50) NOT NULL COMMENT '短标题',
  `title_zh` varchar(100) NOT NULL COMMENT '中文长标题',
  `title1_zh` varchar(100) NOT NULL COMMENT '中文短标题',
  `simg` varchar(150) NOT NULL COMMENT '小图片',
  `imgs` text NOT NULL COMMENT '产品图片',
  `simgs` text NOT NULL COMMENT '多种颜色的小图',
  `maidian` varchar(255) NOT NULL COMMENT '卖点',
  `desc` text NOT NULL COMMENT '产品描述',
  `sizes` varchar(50) NOT NULL COMMENT '尺寸',
  `colors` varchar(50) NOT NULL COMMENT '同款的全部颜色',
  `sizes_ids` varchar(200) NOT NULL COMMENT '尺寸的ID',
  `addtime` datetime NOT NULL COMMENT '添加时间',
  `kd_date` int(10) unsigned NOT NULL COMMENT '刊登时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态',
  `stock` mediumint(8) unsigned NOT NULL COMMENT '库存',
  `kder_id` varchar(60) DEFAULT '' COMMENT '刊登人id',
  `gmer_id` varchar(60) DEFAULT '' COMMENT '跟卖人id',
  `cd_url` varchar(200) NOT NULL COMMENT 'cd的产品url',
  `is_deleted` tinyint(2) DEFAULT '1' COMMENT '是否删除 1：未删除 2：已删除',
  PRIMARY KEY (`id`),
  KEY `cd_id` (`cd_id`)
) ENGINE=MyISAM AUTO_INCREMENT=503 DEFAULT CHARSET=utf8 COMMENT='产品采集表';

-- ----------------------------
-- Records of cd_product
-- ----------------------------

