-- ----------------------------
-- Table structure for kd_product
-- ----------------------------
DROP TABLE IF EXISTS `kd_product`;
CREATE TABLE `kd_product` (
  `id` mediumint(9) unsigned NOT NULL AUTO_INCREMENT,
  `product_id` mediumint(8) unsigned NOT NULL COMMENT '产品ID',
  `ean` varchar(25) NOT NULL,
  `cat_id` mediumint(6) unsigned NOT NULL COMMENT '类别编号',
  `kd_sku` varchar(40) NOT NULL COMMENT '刊登的sku',
  `mt_sku` varchar(60) NOT NULL COMMENT '母体sku',
  `zt_sku` varchar(60) NOT NULL COMMENT '子体sku',
  `color` varchar(10) NOT NULL COMMENT '颜色',
  `size` varchar(50) NOT NULL COMMENT '单个尺寸',
  `store` varchar(50) NOT NULL COMMENT '刊登的店铺名',
  `kd_store_url` varchar(50) NOT NULL COMMENT '刊登的店铺地址',
  `price` decimal(9,2) NOT NULL COMMENT '刊登价格',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态：1已刊登，2已上架，3上架失败',
  `kd_man` mediumint(6) unsigned NOT NULL COMMENT '刊登人',
  `shipfee` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `title1` varchar(50) NOT NULL COMMENT '短标题',
  `title` varchar(100) NOT NULL COMMENT '长标题',
  `simg` varchar(150) NOT NULL COMMENT '小图片',
  `imgs` text NOT NULL COMMENT '产品图片',
  `maidian` varchar(255) NOT NULL COMMENT '卖点',
  `desc` text NOT NULL COMMENT '产品描述',
  `brand` tinyint(3) unsigned DEFAULT NULL COMMENT '品牌ID 与字典表关联 品牌的分类id为1',
  `audiences` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '受众 1成人，2小孩，3婴儿',
  `sex` tinyint(1) unsigned DEFAULT '1' COMMENT '性别 1为男 2为女',
  `colors` varchar(50) NOT NULL COMMENT '同款的全部颜色',
  `stock` mediumint(8) unsigned NOT NULL COMMENT '库存',
  `sizes` varchar(50) NOT NULL COMMENT '尺寸',
  `note` text NOT NULL COMMENT '备注',
  `sjtime` int(10) unsigned NOT NULL COMMENT '上架时间',
  `addtime` int(10) unsigned NOT NULL COMMENT '添加时间',
  `is_kd` tinyint(1) unsigned DEFAULT '0' COMMENT '用来判断标题是否重复的标识字段 1:存在, 0不存在',
  PRIMARY KEY (`id`),
  UNIQUE KEY `zt_sku` (`zt_sku`),
  KEY `cd_id` (`cat_id`)
) ENGINE=MyISAM AUTO_INCREMENT=128 DEFAULT CHARSET=utf8 COMMENT='产品刊登表';

