-- Table structure for t_gm
-- ----------------------------
DROP TABLE IF EXISTS `t_gm`;
CREATE TABLE `t_gm` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `qd_sku` varchar(80) NOT NULL DEFAULT '' COMMENT '渠道sku',
  `price` decimal(6,2) NOT NULL COMMENT '价格  默认为最低跟卖价格，如果没有跟卖价格，默认为售价',
  `shipfee` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '运费',
  `stock` mediumint(8) unsigned NOT NULL COMMENT '库存',
  `d_price` decimal(6,2) NOT NULL COMMENT '底价',
  `store_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `pro_id` mediumint(9) DEFAULT NULL COMMENT '产品表的id',
  `created_man` varchar(32) DEFAULT NULL COMMENT '跟卖人员（销售）',
  `time` datetime DEFAULT NULL COMMENT '跟卖时间（导出表格的时间）',
  `store` varchar(32) DEFAULT NULL COMMENT '店铺（店铺编号）',
  `status` smallint(2) DEFAULT '0' COMMENT '状态（0待跟卖，1跟卖成功,2跟卖失败）',
  `create_time` datetime DEFAULT NULL COMMENT '生成时间（生成时间）',
  `stock_1` mediumint(9) DEFAULT '0' COMMENT '库存1 默认为0',
  `stock_2` mediumint(9) DEFAULT '0' COMMENT '库存2 默认为0',
  `stock_3` mediumint(9) DEFAULT '0' COMMENT '库存3 默认为0',
  `stock_4` mediumint(9) DEFAULT '0' COMMENT '库存4 默认为0',
  `stock_5` mediumint(9) DEFAULT '0' COMMENT '库存5 默认为0',
  `stock_6` mediumint(9) DEFAULT '0' COMMENT '库存6 默认为0',
  `qd_sku_my` varchar(50) DEFAULT NULL,
  `commission_rate` varchar(20) DEFAULT '' COMMENT '佣金比例',
  `time_of_pre` varchar(12) DEFAULT '' COMMENT '发货时效',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='跟卖表';

